from typing import List

class Solution:
    def findAnagrams(self, s: str, p: str) -> List[int]:
        def createCounter(x):
            hsh = dict()
            for ch in x:
                hsh[ch] = hsh.get(ch, 0) + 1
            return hsh
        M = len(s)
        N = len(p)
        res = list()
        cntr_p = createCounter(p)
        cntr_s = createCounter(s[0:N])
        for i in range(0, M-N+1):
            #print(f'\ti, cntr_p, cntr_s = {i}, {cntr_p}, {cntr_s}')
            if cntr_s == cntr_p:
                res.append(i)
            if i == M-N:
                break
            cntr_s[s[i]] -= 1
            if cntr_s[s[i]] == 0:
                del cntr_s[s[i]]
            cntr_s[s[i+N]] = cntr_s.get(s[i+N], 0) + 1
        return res

